    false,nt"url": null,nt"notes": "Echo-sounding tables (3rd Edition) were
    prepared by D.J.T. Carter of the Marine Information and Advisory Service (United
    Kingdom) for the conversion of raw echo-sounding measurements of ocean depths to
    values compensated for variations of sound speed with regional density profiles.
    The tables were computerized by Carter and offer standard velocity-depth corrections
    for 85 different regions covering the globe. The database consists of algorithms
    for determining correction zones by latitude-longitude, and interpolation tables
    for each zone.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
